import React from 'react';
import * as S from './styles';
//nossos componentes
import Header from '../../components/Header';
import Footer from '../../components/Footer';
import FilterCard from '../../components/FilterCard';

function Home() {
  return (
  <S.Container>
    <Header/>

    <FilterCard/>
    <FilterCard/>
    <FilterCard/>
    <FilterCard/>
    <FilterCard/>

    <Footer/>
  </S.Container>
  )
}

export default Home;
